import React, { useState } from 'react'
import './index.css'

const ImagePredection=()=>{
    const [image, setImage] = useState(null);

    const onAddImage = (event) => {
        const file = event.target.files[0];
        if (file) {
            const imageUrl = URL.createObjectURL(file);
            setImage(imageUrl);
        }
    };
    return (
        <div className='predection-container'>
            <h1 className='predict-heading'>Predict Images</h1>
            <div className='inner-conatiner'>
                <div className='image-predection-container'>
                    <div className='input-container'>
                        <input className="input" id="upload-button" type='file' accept="image/*" onChange={onAddImage} />
                    </div>
                    <div className="image-container">
                        {image && <img src={image} alt="Uploaded" className="uploaded-image" />}
                    </div>
                </div>
                <div className='output-container'>
                    <div className='output-heading'>
                        <h1></h1>
                    </div>
                    <div className="output-decription">
                        <h1>Description:</h1>
                        <div className='result-container'>
                            <p></p>
                        </div>
                    </div>
                    <div className="output-decription">
                        <h1>Description:</h1>
                        <div className='result-container'>
                            <p></p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default ImagePredection;
